CGameMath xz;
Vector GetHitboxPosition(IClientEntity* pEntity, int Hitbox)
{
	matrix3x4 matrix[128];


	if (!pEntity->SetupBones(matrix, 128, 0x00000100, pEntity->m_flSimulationTime()))
		return Vector(0, 0, 0);



	studiohdr_t* hdr = m_pModelInfo->GetStudioModel(pEntity->GetModel());
	mstudiohitboxset_t* set = hdr->GetHitboxSet(0);

	mstudiobbox_t* hitbox = set->GetHitbox(Hitbox);

	if (!hitbox)
		return Vector(0, 0, 0);

	Vector vMin, vMax, vCenter, sCenter;
	xz.vector_transform(hitbox->bbmin, matrix[hitbox->bone], vMin);
	xz.vector_transform(hitbox->bbmax, matrix[hitbox->bone], vMax);
	vCenter = (vMin + vMax) *0.5f;
	return vCenter;
}
void CBacktracking::update(int tick_count) {
	
	if (!Shonax::settingsxd.backtrack || !Shonax::settingsxd.legitbacktrack)
		return;

	latest_tick = tick_count;
	for (int i = 0; i < 64; i++) {
		update_record(i);
	}
}

void CBacktracking::legit_backtrack(CUserCmd * cmd, IClientEntity * pLocal)
{
	if (Shonax::settingsxd.legitbacktrack)
	{
		int bestTargetIndex = -1;
		float bestFov = FLT_MAX;
		player_info_t info;
		if (!pLocal->IsAlive())
			return;

		for (int i = 0; i < m_pEngine->GetMaxClients(); i++)
		{
			auto entity = m_pEntityList->GetClientEntity(i);

			if (!entity || !pLocal)
				continue;

			if (entity == pLocal)
				continue;

			if (!m_pEngine->GetPlayerInfo(i, &info))
				continue;

			if (entity->IsDormant())
				continue;

			if (entity->GetTeamNum() == pLocal->GetTeamNum())
				continue;

			if (entity->IsAlive())
			{

				float simtime = entity->m_flSimulationTime();
				Vector hitboxPos = GetHitboxPosition(entity, 0);

				head_positions[i][cmd->command_number % 13] = backtrack_data{ simtime, hitboxPos };
				Vector ViewDir = xz.angle_vector(cmd->viewangles + (pLocal->localPlayerExclusive()->GetAimPunchAngle() * 2.f));
				float FOVDistance = xz.distance_point_to_line(hitboxPos, pLocal->GetEyePosition(), ViewDir);

				if (bestFov > FOVDistance)
				{
					bestFov = FOVDistance;
					bestTargetIndex = i;
				}
			}
		}

		float bestTargetSimTime;
		if (bestTargetIndex != -1)
		{
			float tempFloat = FLT_MAX;
			Vector ViewDir = xz.angle_vector(cmd->viewangles + (pLocal->localPlayerExclusive()->GetAimPunchAngle() * 2.f));
			for (int t = 0; t < Shonax::settingsxd.backtrackticks; ++t)
			{
				float tempFOVDistance = xz.distance_point_to_line(head_positions[bestTargetIndex][t].hitbox_pos, pLocal->GetEyePosition(), ViewDir);
				if (tempFloat > tempFOVDistance && head_positions[bestTargetIndex][t].simtime > pLocal->m_flSimulationTime() - 1)
				{
					tempFloat = tempFOVDistance;
					bestTargetSimTime = head_positions[bestTargetIndex][t].simtime;
				}
			}

			cmd->tick_count = TIME_TO_TICKS(bestTargetSimTime);
		}
	}

}
ConVar* minupdate;
ConVar* maxupdate;
ConVar* updaterate;
ConVar* interprate;
ConVar* cmin;
ConVar* cmax;
ConVar* interp;
float CBacktracking::GetLerpTime()
{
	if (!minupdate)
		minupdate = m_pCVar->FindVar(XorStr("sv_minupdaterate"));
	if (!maxupdate)
		maxupdate = m_pCVar->FindVar(XorStr("sv_maxupdaterate"));
	if (!updaterate)
		updaterate = m_pCVar->FindVar(XorStr("cl_updaterate"));
	if (!interprate)
		interprate = m_pCVar->FindVar(XorStr("cl_interp_ratio"));
	if (!cmin)
		cmin = m_pCVar->FindVar(XorStr("sv_client_min_interp_ratio"));
	if (!cmax)
		cmax = m_pCVar->FindVar(XorStr("sv_client_max_interp_ratio"));
	if (!interp)
		interp = m_pCVar->FindVar(XorStr("cl_interp"));

	float UpdateRate = updaterate->GetFloat();
	float LerpRatio = interprate->GetFloat();
	return max(LerpRatio / UpdateRate, interp->GetFloat());
}

bool CBacktracking::is_valid_tick(int tick) {
	int delta = latest_tick - tick;
	float deltaTime = delta * m_pGlobals->interval_per_tick;
	return (fabs(deltaTime) <= 0.2f);
}

void CBacktracking::update_record(int i) {
	IClientEntity* m_entity = m_pEntityList->GetClientEntity(i);
	if (m_entity && m_entity->IsAlive() && !m_entity->IsDormant()) {
		float lby = m_entity->GetLowerBodyYaw();
		if (lby != records[i].lby) {
			records[i].tick_count = latest_tick;
			records[i].lby = lby;
			records[i].head_position = game::functions.get_hitbox_location(m_entity, 0);
		}
	} else {
		records[i].tick_count = 0;
	}
}

bool CBacktracking::run_lby_backtrack(CUserCmd* m_pcmd, Vector& aim_point) {
	if (Shonax::settingsxd.backtrack) {
		for (int i = 0; i < m_pGlobals->maxClients; i++) {
			auto m_entity = m_pEntityList->GetClientEntity(i);
			auto m_local = game::localdata.localplayer();
			if (!m_entity || m_entity == m_local || m_entity->GetClientClass()->m_ClassID != (int)CSGOClassID::CCSPlayer || !m_entity->IsAlive()) continue;
			if (is_valid_tick(records[i].tick_count)) {
				aim_point = records[i].head_position;
				m_pcmd->tick_count = records[i].tick_count;
				return true;
			}
		}
	}
	return false;
}

